import {useLocation} from "react-router-dom";


export default function () {
    const location = useLocation();

    if (location.state !== null) {
        let {orderItems} = location.state;
        return (
            <div>
                {console.log(orderItems)}
            </div>
        )

    } else {
        return (
            <div>ERROR</div>
        )
    }


}
